import React from "react";
import Cards from "./components/Cards";
import "./App.css";
import { Grid } from "@material-ui/core";

function App() {
  return (
    <>
      <Grid container spacing={3} justify="center">
        <Cards></Cards>
      </Grid>
    </>
  );
}

export default App;
